import React from "react";

import ArticleFeeder from "../components/ArticleFeeder";
import Header from "./Header";

const Homepage = () => {
  return (
    <div>
      <header>
        <Header />
      </header>
      <main>
        <ArticleFeeder />
      </main>
    </div>
  );
};

export default Homepage;
